/*------------------------------DATA TABLE product----------------------------------------*/
/* global resultEmail */

const path_services = "/GICO-AD/webresources";
const path = "/product";
var productos = [];
var providers = [];


function producto(nombre, cantidad, precioUnitario, valorTotal) {
    this.nombre = nombre;
    this.cantidad = cantidad;
    this.precioUnitario = precioUnitario;
    this.valorTotal = valorTotal;
}
function provider(nombre, direccion, cell1) {
    this.nombre = nombre;
    this.direccion = direccion;
    this.cell1 = cell1;
}

$(document).ready(function () {


//-------------------------VENTANA MODAL----------------------------------------  
    var formularioAdd = document.form_add_provider,
            elementosAdd = formularioAdd.elements,
            formularioProvider = document.form_orderNote_report,
            elementProvider = formularioProvider.elements;


// Funcion que se ejecuta cuando el evento click es activado

    var focusInput = function () {
        this.parentElement.children[1].className = "label active";
        this.parentElement.children[0].className = this.parentElement.children[0].className.replace("error", "");
    };

    var blurInput = function () {
        if (this.value <= 0) {
            this.parentElement.children[1].className = "label";
            this.parentElement.children[0].className = this.parentElement.children[0].className + " error";
        }
    };

// --- Eventos ---

    for (var i = 0; i < elementosAdd.length; i++) {
        if (elementosAdd[i].type === "text" || elementosAdd[i].type === "number") {
            elementosAdd[i].addEventListener("focus", focusInput);
            elementosAdd[i].addEventListener("blur", blurInput);
        }
    }
    for (var i = 0; i < elementProvider.length; i++) {
        if (elementProvider[i].type === "text" || elementProvider[i].type === "number") {
            elementProvider[i].addEventListener("focus", focusInput);
            elementProvider[i].addEventListener("blur", blurInput);
        }
    }

//-------------------------FIN VENTANA MODAL----------------------------------------



    productos = [];
    let table = $('#gblTable').DataTable({
        dom: 'Blfrtip',
        lengthMenu: [5, 10, 25, 50],
        buttons: [
            'pdf', 'print'
        ],
        columnDefs: [
            {className: "dt-center", targets: [1, 2, 3, 4]},
            {targets: 3, bSortable: false},
            {targets: 2, bSortable: false, tooltip: "modificar"},
            {targets: 1, bSortable: false}
        ],
        "scrollX": true,
        "scrollY": true,
        responsive: true,
        "language": {"url": "dataTables/languaje.json"},
        ajax: {
            url: `${path_services}${path}/listProduct`, //Traemos informacion del servicio restful
            type: 'GET',
            dataType: 'json',
            dataSrc: ''
        },
        columns: [//carga la informacion en cada columna del datatable
            {data: 'productName'},
            {data: 'productDescription'},
            {data: 'productCount'},
            {data: 'productPrice'},
            {data: iconOrderNote}
        ]

    });
    /*------------------------------ICONOS DATATABLES----------------------------------------*/

    function iconOrderNote(data) {
        let datas = '<a id="orderNote" title="Devolucion en Ventas" href="#" productId-data="' + data.productId + '"productName-data="' + data.productName + '" \n\
         productDescription-data="' + data.productDescription + '" \n\
         productCount-data="' + data.productCount + '" \n\
         productPrice-data="' + data.productPrice + '"productIva-data="' + data.productIva + '"\n\
         productTotalValue-data="' + data.productTotalValue + '" \n\
         productUtility-data="' + data.productUtility + '"productAveragePrice-data="' + data.productAveragePrice + '"\n\
         productDateExpiration-data="' + data.productDateExpiration + '" class="icon-table">\n\
         <i class="fa fa-shopping-cart" aria-hidden="true"></i></a>';
        return datas;
    }

    /*------------------------------RETURN SALE product----------------------------------------*/

    function orderNoteProduct() {
        let productName = $('#productName-orderNoteModal').text();
        let productPrice = $('#productPrice-orderNoteModal').text();
        let productCount = $('#productCount-orderNoteModal').text();
        let productNewCount = $('input[name="productNewCount-orderNote"]').val();

        if (productNewCount > 0) {
            if ((productNewCount > parseFloat(productCount))) {
                alert('ERROR\n\
                   La cantidad deseada es mayor a la que se posee en stock');
            } else {
                let total = parseFloat(productNewCount) * parseFloat(productPrice);
                let precio = parseFloat(productPrice) * 1;
                let produc = new producto(productName, productNewCount, precio.toFixed(2), total.toFixed(2));
                productos.push(produc);
            }
        } else {
            alert('ERROR\n\
                    Cantidad incorrecta');
        }

    }

    $(document).on('click', 'a#orderNote', function (e) {//Mostrar la ventana modal de agregar stock producto
        e.preventDefault();
        let productId = $(this).attr("productId-data");
        let productName = $(this).attr("productName-data");
        let productDescription = $(this).attr("productDescription-data");
        let productPrice = $(this).attr("productPrice-data");
        let productIva = $(this).attr("productIva-data");
        let productDateExpiration = $(this).attr("productDateExpiration-data");
        let productCount = $(this).attr("productCount-data");
        let productTotalValue = $(this).attr("productTotalValue-data");
        let productUtility = $(this).attr("productUtility-data");
        let productAveragePrice = $(this).attr("productAveragePrice-data");

        $('#windows-orderNote-product').removeClass('hide-modal'); //Muestra la ventan modal

        $('#productId-orderNoteModal').text(productId);
        $('#productName-orderNoteModal').text(productName);
        $('#productDescription-orderNoteModal').text(productDescription);
        $('#productPrice-orderNoteModal').text(productPrice);
        $('#productIva-orderNoteModal').text(productIva);
        $('#productDateExpiration-orderNoteModal').text(productDateExpiration);
        $('#productCount-orderNoteModal').text(productCount);
        $('#productTotalValue-orderNoteModal').text(productTotalValue);
        $('#productUtility-orderNoteModal').text(productUtility);
        $('#productAveragePrice-orderNoteModal').text(productAveragePrice);
    });
    $(document).on('click', '#closeIcon-orderNote', function () {// Cerrar la Ventana Modal desde el icono
        $('#windows-orderNote-product').toggleClass('hide-modal');
        $("#id-form-orderNote-product")[0].reset();
    });
    $(document).on('click', '#orderNote-product-cancel', function () {//Boton CANCELAR modificar producto 
        $('#windows-orderNote-product').toggleClass('hide-modal');
        $("#id-form-orderNote-product")[0].reset();
    });
    $(document).on('click', '#orderNote-product', function () {//Boton ACEPTAR modificar producto 
        orderNoteProduct();
        $("#id-form-orderNote-product")[0].reset();
        $('#windows-orderNote-product').toggleClass('hide-modal');
    });


    var temporal = 0;
    $(document).on('click', '#id-add-report', function () {// Mostrar ventana modal ingresar producto    
        $("#form-add-report")[0].reset();
        $.ajax({
            url: "/GICO-AD/webresources/provider/listProvider",
            type: 'GET',
            dataType: 'json',
            dataSrc: '',
            success: function (datas) {
                
                if (temporal === 0) {
                    temporal++;
                    for (var i = 0; i < datas.length; i++) {
                        $("#providerId-addModal").append(
                                '<option value="' + datas[i].providerId + '">' + datas[i].providerName + '</option>'
                                );
                    }
                }
            }
        });
        $('#windows-add-provider').removeClass('hide-modal');
    });

    $(document).on('click', '#closeIcon-add', function () {
        $('#windows-add-provider').toggleClass('hide-modal');
    });

    $(document).on('click', '#add-report-cancel', function () {
        $('#windows-add-provider').toggleClass('hide-modal');
    });

    $(document).on('click', '#add-report', function () {
        $('#windows-add-provider').toggleClass('hide-modal');
        providers = [];
        let providerId = $('#providerId-addModal').val();
        let providerName;
        let providerCI;
        let providerAddres;
        let providerCell1;
        $.ajax({
            url: "/GICO-AD/webresources/provider/listProvider",
            type: 'GET',
            dataType: 'json',
            dataSrc: '',
            success: function (datas) {
                for (var i = 0; i < datas.length; i++) {
                    if (datas[i].providerId == providerId) {
                        providerName = datas[i].providerName;
                        providerAddress = datas[i].providerAddress;
                        providerCell1=datas[i].providerCell1;
                        let prov = new provider(providerName, providerAddress, providerCell1);
                        providers.push(prov);
                        i = datas.length;
                    }
                }
            }
        });

    });

    $(document).on('click', '#id-create-report', function () {
        if (providers.length > 0) {
            orderNotePDF();
        } else {
            alert('El proveedor no ha sido asignado');
        }
    });


    function orderNotePDF() {
        if (productos.length > 0) {
            var reporte = new jsPDF('p', 'mm', 'a4');

//          reporte.text(productos[0].nombre, largo,alto); 
            reporte.setFontSize(15);
            reporte.setFont("times");
            reporte.setFontType("bold");
            reporte.text('COMERCIAL ORTIZ', 45, 30); //(texto,derecha,izquierda)
                        
            reporte.setFontSize(13);
            reporte.text('Telefono: 0987654321', 47, 40);
            reporte.setFontType("normal");
            reporte.text('NOTA DE PEDIDO', 49, 50);
            var fecha = new Date();
            var mm = fecha.getMonth() + 1;
            reporte.text('Lugar: Mocha', 25, 60);
            reporte.text('Fecha: ' + fecha.getDate() + ' / ' + mm + ' / ' + fecha.getFullYear() + '', 25, 70);
            reporte.text('Sr(a): ' + providers[0].nombre + ' ', 25, 80);
            reporte.text('CI: ' + providers[0].ci + ' ', 25, 90);
            reporte.text('Direccion: ' + providers[0].direccion + ' ', 25, 100);
            reporte.setFontSize(13);
            reporte.setFont("times");
            reporte.setFontType("bold");
//          reporte.setTextColor(255, 0, 0);
            reporte.text('_____________________________________________________________________________', 25, 105);
            reporte.text(' Cant.        Nombre                                                                                   P. Unitario     P. Total', 25, 113);
            reporte.text('_____________________________________________________________________________', 25, 115);
            reporte.setFontType("normal");
            let interlineado = 123;
            let sumaTotal = 0;
            for (var i = 0; i < productos.length; i++) {
                reporte.text('' + productos[i].cantidad + ' ', 25, interlineado);
                reporte.text('' + productos[i].nombre + ' ', 45, interlineado);
                reporte.text('' + productos[i].precioUnitario + ' ', 165, interlineado);
                reporte.text('' + productos[i].valorTotal + ' ', 188, interlineado);
                if (interlineado >= 293) {
                    reporte.addPage();
                    interlineado = 33;
                } else {
                    interlineado = interlineado + 10;
                }
                sumaTotal = sumaTotal + parseFloat(productos[i].valorTotal);
            }
            reporte.setFontType("bold");
            if (interlineado > 280) {
                reporte.addPage();
                interlineado = 33;
            } else {
                interlineado = interlineado + 6;
            }
            reporte.text('_____________________________________________________________________________', 25, interlineado);
            interlineado = interlineado + 10;
            reporte.text(' TOTAL                                                                                                                                ' + sumaTotal.toFixed(2) + '', 25, interlineado);

            var imgData = 'data:image/jpeg;base64,';
//            var imgData = 'data:image/png;base64,';
            reporte.addImage(imgData, 'PNG', 15, 25, 30, 30); //(derecha,abajo,tamaño x,tamaño y)
            reporte.save('quemasve.pdf');
        } else {
            alert('la lista de pedido esta vacia');
        }
    }

});
